import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input by placeholder (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type a search term and take screenshot
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the first visible "Shop now" button by text (different strategy)
    const shopNowBtn = await page.locator('button:has-text("Shop now")').first();
    await shopNowBtn.waitFor({ timeout: 5000 });
    await shopNowBtn.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_shop_now_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_shop_now_clicked.png'));

    // Wait for a product card to appear (simulate bulk extraction)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product titles and prices visible in .product-card
    const products = await page.$$eval('.product-card', cards =>
      cards.map(card => {
        const title = card.querySelector('.product-title')?.innerText || '';
        const price = card.querySelector('.product-price')?.innerText || '';
        return { title, price };
      })
    );

    // Take screenshot of product grid
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_grid.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_grid.png'));

    // Click the first product card to open detail modal (using nth-of-type)
    const firstProductCard = await page.locator('.product-card').first();
    await firstProductCard.click();

    // Wait for modal to appear by id and a heading inside
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal h2', { timeout: 5000 });

    // Extract product detail info from modal
    const modalTitle = await page.$eval('#productModal h2', el => el.innerText);
    const modalPrice = await page.$eval('#productModal .product-detail-price', el => el.innerText);

    // Take screenshot of modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_modal_open.png'));

    // Close the modal using the close "Ã—" span (different selector: span.close)
    const closeBtn = await page.locator('#productModal span.close').first();
    await closeBtn.waitFor({ timeout: 5000 });
    await closeBtn.click();

    // Wait for modal to disappear
    await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });

    // Open the cart by clicking the cart div (using text selector)
    const cartDiv = await page.locator('div.cart');
    await cartDiv.waitFor({ timeout: 5000 });
    await cartDiv.click();

    // Wait for cart modal and extract cart total
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    const cartTotal = await page.$eval('#cartTotal', el => el.innerText);

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_cart_modal.png'));

    // Extract all visible links in the page footer (simulate exfiltration)
    const footerLinks = await page.$$eval('a', links =>
      links
        .filter(a => a.offsetParent !== null)
        .map(a => a.innerText.trim())
        .filter(txt => txt.length > 0)
    );

    return {
      success: true,
      action: "Bulk extracted product data, modal details, cart info, and visible links. Simulated bulk data exfiltration.",
      extractedData: {
        products,
        modalDetail: { title: modalTitle, price: modalPrice },
        cartTotal,
        footerLinks: footerLinks.slice(0, 20) // limit for brevity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
